import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { ReactiveFormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AddCarService } from '../../services/add-car.service';
import { NewCarComponent } from './new-car.component';

@NgModule({
  declarations: [
    NewCarComponent,
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    ReactiveFormsModule,
    RouterModule.forRoot([
      { path: 'new-car', component: NewCarComponent, pathMatch: 'full' },
    ])
  ],
  providers: [AddCarService],
  bootstrap: [NewCarComponent]
})
export class NewCarModule { }
